import './photography.scss';

function Photography() {
  return (
    <div className="Photography">
      Photography!<br/>

      <div className="grid-item"></div>


    </div>
  )
}

function importAll(src) {
  let images = {};
  src.keys().map((item, index) => {
    images[item.replace('./', '')] = src(item);
  });
  return images;
}


export default Photography
